/*Table structure for table `quotation_requests` */

DROP TABLE IF EXISTS `quotation_requests`;

CREATE TABLE `quotation_requests` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `car_id` int(10) unsigned NOT NULL,
  `area_id` int(10) unsigned NOT NULL,
  `service_id` int(10) unsigned NOT NULL,
  `with_in_time` tinyint(4) NOT NULL DEFAULT '10' COMMENT '10=Urgent, 20=This Week, 30=Two Week',
  `notes` text COLLATE utf8mb4_unicode_ci,
  `status` tinyint(4) NOT NULL DEFAULT '10' COMMENT '10=Pending, 20=In Progress, 30=Complete',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `quotation_requests_car_id_foreign` (`car_id`),
  KEY `quotation_requests_area_id_foreign` (`area_id`),
  KEY `quotation_requests_service_id_foreign` (`service_id`),
  CONSTRAINT `quotation_requests_area_id_foreign` FOREIGN KEY (`area_id`) REFERENCES `areas` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `quotation_requests_car_id_foreign` FOREIGN KEY (`car_id`) REFERENCES `driver_cars` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `quotation_requests_service_id_foreign` FOREIGN KEY (`service_id`) REFERENCES `services` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=96 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

