/*Table structure for table `thread_message_status` */

DROP TABLE IF EXISTS `thread_message_status`;

CREATE TABLE `thread_message_status` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `message_id` int(10) unsigned NOT NULL,
  `user_id` int(10) unsigned NOT NULL,
  `message_status` tinyint(4) NOT NULL DEFAULT '10' COMMENT '10=Pending, 20=Delivered, 30=Read',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0,1',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `thread_message_status_message_id_foreign` (`message_id`),
  KEY `thread_message_status_user_id_foreign` (`user_id`),
  CONSTRAINT `thread_message_status_message_id_foreign` FOREIGN KEY (`message_id`) REFERENCES `thread_messages` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `thread_message_status_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

